tectural photography, drawings, and sketches A look behind the scenes with one of the world?s leading architects In many regards, architecture of the 21st century has to fit a square peg into a round hole. It should be energetic and meaningful and yet be as sustainable as possible in all details. It should offer ample and proportioned space for its inhabitants, but also fit harmoniously into its environment. Architect Jean-Francois Koenig has been meeting these requirements for four decades. With the goal of improving the life quality of the inhabitants and users of his buildings, he sets out elaborate aesthetic designs that also include infrastructure and transport connections. The projects in Jean-Francois Koenig?s portfolio?including offices, private houses, hotels, public buildings, and schools?reflect his enhancement and integration of the many facets of urban life. When he won the third prize in a RIBA (Royal Institute of British Architects) competition in 1979, with Norman Foster as judge, Koenig was the only architecture student among the winners. Even at that stage, his sketch for a pedestrian link between Trafalgar Square and Leicester Square demonstrated his sense for the city environment, not to mention his outstanding graphic talent. One of Koenig?s many esteemed projects is the Commercial Bank on the island of Mauritius, Koenig?s native home, where he continues to reside."}]}}, {"600": {"ind1": "1", "ind2": "0", "subfields": [{"a": "Koenig, Jean-François."}]}}, {"650": {"ind1": " ", "ind2": "0", "subfields": [{"a": "Architects"}, {"z": "Mauritius."}]}}, {"650": {"ind1": " ", "ind2": "0", "subfields": [{"a": "Architecture"}, {"z": "Mauritius."}]}}, {"949": {"ind1": " ", "ind2": " ", "subfields": [{"a": "NA1599.5 .M383 K642 2018"}, {"h": "DES-STACKS"}, {"i": "S03325640N"}, {"k": "ONORDER"}, {"z": "YBPCAT"}]}}, {"980": {"ind1": " ", "ind2": " ", "subfields": [{"a": "180625"}, {"b": "65.00"}, {"e": "65.00"}, {"f": "619489"}, {"g": "1"}]}}, {"983": {"ind1"