INSERT INTO test_tenant_mod_source_record_storage.marc_records_lb (id, content) VALUES ('2a833123-b828-48ef-a27d-2d00ca36f5c4','{"fields": [{"001": "4863735"}, {"008": "941108i| anannbabn          |a ana      "}, {"005": "20231221113541.3"}, {"010": {"ind1": " ", "ind2": " ", "subfields": [{"a": "sh 94008233 "}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)sh 94008233"}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)6596154"}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)sp 94008233"}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)331813"}]}}, {"040": {"ind1": " ", "ind2": " ", "subfields": [{"a": "DLC"}, {"c": "DLC"}, {"d": "DLC"}, {"d": "IAhCCS"}, {"d": "WaU"}]}}, {"150": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Graphic novels"}]}}, {"360": {"ind1": " ", "ind2": " ", "subfields": [{"i": "subdivision"}, {"a": "Comic books, strips, etc."}, {"i": "under names of individual persons; under individual sacred works, e.g."}, {"a": "Bible--Comic books, strips, etc.;"}, {"i": "and under topical headings; and headings for genres of comic books, e.g."}, {"a": "Fantasy comic books, strips, etc."}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Comic book novels"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Fiction graphic novels"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Fictive graphic novels"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Graphic albums"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Graphic fiction"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Graphic nonfiction"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Graphic novellas"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Nonfiction graphic novels"}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Comic books, strips, etc."}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Fiction"}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Popular literature"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Work cat.: 94023984: Rothschild, D.A. Graphic novels, 1995."}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "LC database, Nov. 3, 1994"}, {"b": "(40+ entries for individual graphic novels under series title)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "City of light, city of dark, c1993:"}, {"b": "t.p. (comic-book novel)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Rothschild, D.A. Graphic novels, 1995:"}, {"b": "p. xiii (a graphic novel is a sturdy, lengthy comic book that contains a single story or a set of interrelated stories told using \"sequential art\"; other terms: trade comics (which already has a meaning in the industry); commix, invented by Art Spiegelman to describe \"a co-mixing of words and pictures\" (too similar to comics and comix to catch on); graphic album (the European term--same problem as graphic novel, with audio overtones); illu-novel (too clunky to catch on); and gekiga (the Japanese term for the genre))"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Gorman, M. Getting graphic!, c2003:"}, {"b": "p. xii (graphic novel is used in the library profession to describe an original book-length story, either fiction or nonfiction, published in comic book style or a collection of stories that have been published previously as individual comic books; conventional graphic novel begins and ends a story within the first and last page of the book; the use of the seemingly erroneous label of \"novel\" for all books created in a comic-style format must be understood and accepted as the status quo) p. 60 (graphic nonfiction) p. 66 (graphic work of nonfiction)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Wikipedia, July 26, 2005"}, {"b": "(Graphic novel (sometimes abbreviated GN) is a term for a kind of book, usually telling an extended story with sequential art (i.e. comics); most broadly used to refer to any long-form comic book or manga, i.e. the comics analogue to a prose novel or novella; can apply to works which were previously published serially in periodical comic books, or to works produced specifically for book-format publication; some use the term \"graphic novella\" for works that fit the general sense of the term (a single, well-developed story), but are less than 100 pages; in the book trade the term is sometimes extended to include material that would not be considered a \"novel\" if produced in another medium. Collections of comic book issues that do not form a single continuous story, anthologies of short loosely-related pieces, and even non-fiction are stocked by libraries and bookstores as \"graphic novels\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Lyga, A.A.W. Graphic novels in your media center, 2004:"}, {"b": "p. 15 (comic books can--and do--encompass the entire range of fiction and nonfiction) p. 17 (all graphic novels are comic books, but not all comic books are graphic novels)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Goldsmith, F. Graphic novels now, 2005:"}, {"b": "p. 16 (To date, publishers and librarians have not devised a term to replace the misnomer graphic novel when referring to nonfiction. For now, then, graphic novel may be applied to works that are either factual or fictive. Further, a fictive graphic novel may be a single short story or a collection of short stories rather than a novel in the literary sense of a lengthy work that entails subplots and other complexities.) p. 17 (Graphic novels are not a type of picture book; that is, they are not stories accompanied by illustrations that largely repeat the content of the written text. ... The graphic novel indeed includes pictures, but the images must be integrated with the text so that together they provide a narrative that is richer than either element can provide alone.)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Wikipedia, Dec. 5, 2012"}, {"b": "(Category: Non-fiction graphic novels) Non-fiction comics (Non-fiction comics, also known as graphic non-fiction, is non-fiction in the comics medium, embracing a variety of formats from comic strips to trade paperbacks.)"}]}}, {"675": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Ward. Longman companion to twentieth century literature, 1991;"}, {"a": "Random House;"}, {"a": "Web. 3"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "0533"}, {"u": "te04"}, {"v": "0"}]}}, {"910": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Proposal saved by tc03 on 02/26/2013 at 11:18:18"}]}}, {"953": {"ind1": " ", "ind2": " ", "subfields": [{"a": "lk03"}, {"b": "ec09"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "1302"}, {"v": "0"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "2a833123-b828-48ef-a27d-2d00ca36f5c4"}, {"i": "53085247-7ec2-4f1e-a4ec-fabca9b99347"}]}}], "leader": "05096cz  a2200469n  4500"}');
