INSERT INTO test_tenant_mod_source_record_storage.marc_records_lb (id, content) VALUES ('55df815e-65f7-4735-beb5-d4bc8b13f980','{"fields": [{"001": "10983478"}, {"008": "181113 | anannbabn          |a ana     c"}, {"005": "20231214124230.7"}, {"010": {"ind1": " ", "ind2": " ", "subfields": [{"a": "sh2018002914"}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "sh2018002914"}]}}, {"040": {"ind1": " ", "ind2": " ", "subfields": [{"a": "MnU"}, {"b": "eng"}, {"c": "MnU"}]}}, {"150": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Afrofuturism"}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Arts, American"}, {"y": "20th century"}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Arts, American"}, {"y": "21st century"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Work cat.: 2013025755: Womack, Ytasha L. Afrofuturism : the world of black sci-fi and fantasy culture, 2013."}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "2015035409: Afrofuturism 2.0 : the rise of astro-blackness, 2016."}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Steinskog, Erik (Musicologist). Afrofuturism and black sound studies : culture, technology, and things to come, 2018."}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "English Oxford Dictionary, viewed online July 13 2018"}, {"b": "(\"Afrofuturism: A movement in literature, music, art, etc., featuring futuristic or science fiction themes which incorporate elements of black history and culture.\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Tate Museum WWW site, Jan. 9, 2019:"}, {"b": "(Afrofuturism: a cultural aesthetic that combines science-fiction, history and fantasy to explore the African-American experience and aims to connect those from the black diaspora with their forgotten African ancestry; The term afrofuturism has its origins in African-American science fiction; today it is generally used to refer to literature, music, and visual art that explores the African-American experience and in particular the role of slavery in that experience)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Africa and the Americas: culture, politics, and history, 2008:"}, {"b": "Afrofuturism (Afrofuturism is an African American literary and artistic movement addressing the transatlantic issues of displacement, home, and belonging. In speculative fiction, some of the major recurring themes have included alien intrusion and subjugation, forced displacement, and the quest to return to the native land and to regain a lost sense of cultural location. All of these themes would have a very natural appeal to African American writers and readers, and yet until the last few decades of the twentieth century, there was little African American visibility in the genres of science fiction and science fantasy.)"}]}}, {"910": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Proposal saved by tc03 on 01/28/2019 at 10:05:49"}]}}, {"952": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Bib. records to be changed: 6"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "1901"}, {"v": "0"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "55df815e-65f7-4735-beb5-d4bc8b13f980"}, {"i": "4d9857d2-90f9-4b15-b13b-025ad5b1fafa"}]}}], "leader": "02379cz  a2200253n  4500"}');
