INSERT INTO test_tenant_mod_source_record_storage.marc_records_lb (id, content) VALUES ('7b3aa1cb-89c6-4733-93d3-ab094b8d7adf','{"fields": [{"001": "4667442"}, {"008": "860211i| anannbabn          |a ana     |"}, {"005": "20231214124109.1"}, {"010": {"ind1": " ", "ind2": " ", "subfields": [{"a": "sh 85014672 "}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)sh 85014672"}]}}, {"035": {"ind1": " ", "ind2": " ", "subfields": [{"a": "(DLC)14127"}]}}, {"040": {"ind1": " ", "ind2": " ", "subfields": [{"a": "DLC"}, {"c": "DLC"}, {"d": "DLC"}, {"d": "PPiU"}]}}, {"150": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Black people"}]}}, {"360": {"ind1": " ", "ind2": " ", "subfields": [{"i": "subdivision"}, {"a": "Black people"}, {"i": "under individual wars, e.g."}, {"a": "World War, 1939-1945--Black people;"}, {"i": "and headings beginning with the word"}, {"a": "Black"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Black persons"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"w": "nne"}, {"a": "Blacks"}]}}, {"450": {"ind1": " ", "ind2": " ", "subfields": [{"w": "nne"}, {"a": "Negroes"}]}}, {"550": {"ind1": " ", "ind2": " ", "subfields": [{"w": "g"}, {"a": "Ethnology"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Work cat.: Fryer, P. Black people in the British Empire, 2021"}, {"w": "(OCoLC)1247944144"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "King, D. Why we don''t call people \"blacks\" and \"whites\", Dec. 22, 2016, via SplinterNews, viewed Mar. 19, 2021"}, {"b": "(\"The core problem with ''a'' black and ''a'' white is that they imply there''s a word missing--person. A black person. A white person. It''s the grammatical equivalent of de-personization, or dehumanization: Person is gone. Race is all;\" \"The split second it takes to expand ''blacks'' and ''whites'' into ''black people'' and ''white people'' is a small price to pay for accurately characterizing people''s lives\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Encyclopedia of African-American Culture and History (ed. by C. A. Palmer), 2nd ed., 2006:"}, {"b": "Introduction (blacks)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Encyclopedia of Black Studies, edited by Molefi Kete Asante, and Mambo Ama Mazama, 2004 :"}, {"b": "Introduction p. xxv (\"This is not merely an encyclopedia of black culture or an encyclopedia of black people...\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Merriam-Webster WWW, viewed on May 20, 2021:"}, {"b": "(\"Black or less commonly black : a) : a person belonging to any of various population groups of especially African ancestry often considered as having dark pigmentation of the skin but in fact having a wide range of skin colors ... b) : African American ... Note: Use of the noun Black in the singular to refer to a person is considered offensive. The plural form Blacks is still commonly used by Black people and others to refer to Black people as a group or community, but the plural form too is increasingly considered offensive, and most style guides advise writers to use Black people rather than Blacks when practical.\")"}, {"u": "https://www.merriam-webster.com/dictionary/black"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "National Association of Black Journalists. Style guide WWW, viewed on June 28, 2021:"}, {"b": "African, African American, Black (\"In news copy, aim to use Black as an adjective, not a noun. Also, when describing a group, use Black people instead of just ''Blacks.''\")"}]}}, {"680": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Here are entered works on Black people as an element in the population. Theoretical works discussing the black race from an anthropological point of view are entered under"}, {"a": "Black race."}]}}, {"680": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Works on Black people in countries whose racial composition is predominantly black are assigned headings appropriate for the country as a whole without the use of the heading"}, {"a": "Black people."}, {"i": "The heading"}, {"a": "Black people"}, {"i": "is assigned to works on such countries only if the work discusses Black people apart from other groups in the country."}]}}, {"681": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Note under"}, {"a": "Black race; Urban Black people"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "9014"}, {"u": "fk05"}, {"v": "0"}]}}, {"910": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Proposal saved by js06 on 01/03/2022 at 10:03:14"}]}}, {"952": {"ind1": " ", "ind2": " ", "subfields": [{"a": "LC Pattern: Racially mixed people"}]}}, {"952": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Submitted for the African American SACO Funnel Project"}]}}, {"953": {"ind1": " ", "ind2": " ", "subfields": [{"a": "xx00"}, {"b": "fj21"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "2112a"}, {"v": "0"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "7b3aa1cb-89c6-4733-93d3-ab094b8d7adf"}, {"i": "582de774-3747-4a69-8a79-973fbf9d1b6c"}]}}], "leader": "03513cz  a2200373n  4500"}');
