 for the most gifted heroes.)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Serchay, D.S. The librarian''s guide to graphic novels for adults, c2010:"}, {"b": "pp. 39-41 (Graphic novels come in all genres, both fiction and nonfiction--superhero, adventure, mystery, science fiction, fantasy, crime, true crime, horror, romance, historical fiction, historical nonfiction, biography, autobiography, memoir, and more; Superhero. The vast majority of trades are in the superhero genres, with over 70 years worth of stories available) p. 53 (The term can also be written as \"super-hero\" or \"super hero\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Best superhero/supervillain comics, via Goodreads website, Dec. 6, 2012."}]}}, {"910": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Proposal saved by tc03 on 10/07/2015 at 09:18:16"}]}}, {"985": {"ind1": " ", "ind2": " ", "subfields": [{"a": "MvI"}]}}, {"985": {"ind1": " ", "ind2": " ", "subfields": [{"e": "Literature project"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "1516"}, {"v": "0"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "7c201c8f-89bd-4944-84b7-a13ff53f682f"}, {"i": "dd67276b-2364-4278-9b28-eaa654cab7e2"}]}}], "leader": "02408nz  a2200229n  4500"}');
