nd practice. Beginning with Laugier''s 1753 ''Essay on Architecture,'' this book traces type through 19th- and 20th-century architectural movements and theories, culminating in a discussion of the affinities between architectural type and Duchamp''s concept of the readymade."}]}}, {"949": {"ind1": " ", "ind2": " ", "subfields": [{"h": "DES-STACKS"}, {"i": "S03325643Q"}, {"k": "ONORDER"}, {"z": "YBPCAT"}]}}, {"980": {"ind1": " ", "ind2": " ", "subfields": [{"a": "180625"}, {"b": "39.95"}, {"e": "39.95"}, {"f": "619489"}, {"g": "1"}]}}, {"983": {"ind1": " ", "ind2": " ", "subfields": [{"a": "40028264772"}]}}, {"985": {"ind1": " ", "ind2": " ", "subfields": [{"a": "DSFIR-APRV"}, {"e": "YANKEE"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "cdc88910-b761-47cf-a3bd-6a25d27fd9dd"}, {"i": "6a184c87-97ba-4cc4-a600-91e7d93f040f"}]}}], "leader": "01677cam a2200289M  4500"}');
