: " ", "ind2": " ", "subfields": [{"a": "Encyclopedia of African-American Culture and History (ed. by C. A. Palmer), 2nd ed., 2006:"}, {"b": "Introduction (blacks)"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Encyclopedia of Black Studies, edited by Molefi Kete Asante, and Mambo Ama Mazama, 2004 :"}, {"b": "Introduction p. xxv (\"This is not merely an encyclopedia of black culture or an encyclopedia of black people...\")"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Merriam-Webster WWW, viewed on May 20, 2021:"}, {"b": "(\"Black or less commonly black : a) : a person belonging to any of various population groups of especially African ancestry often considered as having dark pigmentation of the skin but in fact having a wide range of skin colors ... b) : African American ... Note: Use of the noun Black in the singular to refer to a person is considered offensive. The plural form Blacks is still commonly used by Black people and others to refer to Black people as a group or community, but the plural form too is increasingly considered offensive, and most style guides advise writers to use Black people rather than Blacks when practical.\")"}, {"u": "https://www.merriam-webster.com/dictionary/black"}]}}, {"670": {"ind1": " ", "ind2": " ", "subfields": [{"a": "National Association of Black Journalists. Style guide WWW, viewed on June 28, 2021:"}, {"b": "African, African American, Black (\"In news copy, aim to use Black as an adjective, not a noun. Also, when describing a group, use Black people instead of just ''Blacks.''\")"}]}}, {"680": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Here are entered works on Black people as an element in the population. Theoretical works discussing the black race from an anthropological point of view are entered under"}, {"a": "Black race."}]}}, {"680": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Works on Black people in countries whose racial composition is predominantly black are assigned headings appropriate for the country as a whole without the use of the heading"}, {"a": "Black people."}, {"i": "The heading"}, {"a": "Black people"}, {"i": "is assigned to works on such countries only if the work discusses Black people apart from other groups in the country."}]}}, {"681": {"ind1": " ", "ind2": " ", "subfields": [{"i": "Note under"}, {"a": "Black race; Urban Black people"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "9014"}, {"u": "fk05"}, {"v": "0"}]}}, {"910": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Proposal saved by js06 on 01/03/2022 at 10:03:14"}]}}, {"952": {"ind1": " ", "ind2": " ", "subfields": [{"a": "LC Pattern: Racially mixed people"}]}}, {"952": {"ind1": " ", "ind2": " ", "subfields": [{"a": "Submitted for the African American SACO Funnel Project"}]}}, {"953": {"ind1": " ", "ind2": " ", "subfields": [{"a": "xx00"}, {"b": "fj21"}]}}, {"906": {"ind1": " ", "ind2": " ", "subfields": [{"t": "2112a"}, {"v": "0"}]}}, {"999": {"ind1": "f", "ind2": "f", "subfields": [{"s": "d1e2eb64-78e1-4054-a90c-1ba661714244"}, {"i": "3fba683b-73af-492e-bcc6-1f8e697a1d65"}]}}], "leader": "03513cz  a2200373n  4500"}');
