CREATE SCHEMA IF NOT EXISTS test_tenant_mod_source_record_storage;

DO
$$
DECLARE
BEGIN
    IF NOT EXISTS (SELECT 1 FROM pg_type WHERE typname = 'record_state') THEN
      CREATE TYPE test_tenant_mod_source_record_storage.record_state AS ENUM
        ('ACTUAL', 'DRAFT', 'OLD', 'DELETED');
    END IF;

    IF NOT EXISTS (SELECT 1 FROM pg_type WHERE typname = 'record_type') THEN
      CREATE TYPE test_tenant_mod_source_record_storage.record_type AS ENUM
        ('MARC_BIB', 'MARC_AUTHORITY', 'MARC_HOLDING', 'EDIFACT');
    END IF;
END;
$$ LANGUAGE PLPGSQL;

CREATE TABLE IF NOT EXISTS test_tenant_mod_source_record_storage.records_lb
(
    id uuid NOT NULL,
    snapshot_id uuid NOT NULL,
    matched_id uuid NOT NULL,
    generation integer NOT NULL,
    record_type test_tenant_mod_source_record_storage.record_type NOT NULL,
    external_id uuid,
    state test_tenant_mod_source_record_storage.record_state NOT NULL,
    leader_record_status character(1),
    "order" integer,
    suppress_discovery boolean DEFAULT false,
    created_by_user_id uuid,
    created_date timestamp with time zone,
    updated_by_user_id uuid,
    updated_date timestamp with time zone,
    external_hrid text,
    CONSTRAINT records_lb_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS test_tenant_mod_source_record_storage.marc_records_lb
(
    id uuid NOT NULL,
    content jsonb NOT NULL,
    CONSTRAINT marc_records_lb_pkey PRIMARY KEY (id)
);




